export class SupportBaseType  {
    name =  (index) =>{

        try {
    
            for (var i = 0; i < this._codedValue.length; i++) {
    
                if (this._codedValue[i].code == index) {
                    return this._codedValue[i].name;
                }
            }
    
            return "nothing";
        } catch (err) {
            alert(err.message);
        }
    }

  _codedValue= [
    {
     "name": "T-Base",
     "code": 1
    },
    {
     "name": "Wood",
     "code": 2
    },
    {
     "name": "Metal",
     "code": 3
    },
    {
     "name": "Surface Mount",
     "code": 4
    },
    {
     "name": "Other",
     "code": 5
    },
    {
     "name": "None",
     "code": 6
    }
   ]

}
